import { getSongs } from "../pages/api";

import Layout from "../components/Layout";

class Retrive extends React.Component {
  constructor() {
    super();
    this.state = {
      songs: []
    };
  }

  async componentWillMount() {}

  render() {
    return (
      <Layout>
        <div>{this.state.songs}</div>
      </Layout>
    );
  }
}

export default Retrive;
